  const navigate = useNavigate();

  return (
    <style.Container>
      <TestCard title="test1" onClick={() => navigate('/reationtimetest')} />
      <TestCard
        title="test2"
        onClick={() => {
          console.log(1);
        }}
      />
      <TestCard title="test3" />
    </style.Container>
  );
}
